// import './App.css';
import Home from "./Components/Home/Home";
import {BrowserRouter,Routes,Route} from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element = { <Home /> } />
          <Route path="view-cart" />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
